    false,nt"url": null,nt"notes": "This annual narrative report for Canaan
    Valley NWR outlines Refuge accomplishments during the 1996 and 1997 calendar years.
    The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning and public participation. Refuge administration is outlined;
    information about personnel, volunteer programs, and funding is given. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    and shorebirds. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, and law enforcement. The equipment and facilities
    section of the report provides information about equipment replacement. Items of
    interest are provided at the end. Refuge brochures and the hunting plan are attached.",nt"owner_org":
